import Head from "next/head";
import styled from "styled-components";
import Layout from "../component/Layout";
const Test = styled.div`
  color: red;
`;
const Index = () => (
  <div>
    <Head>
      <meta charSet="utf-8" />
      <title>Index 페이지</title>
    </Head>
    <Layout>Hello inyong~!</Layout>
  </div>
);

export default Index;
